import React,{useState} from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView,KeyboardAvoidingView,Picker,TextInput,Platform,ScrollView} from 'react-native';
import {css} from '../assets/Css/css';
import { TextInputMask } from 'react-native-masked-text';

export default function Teste2 ({route}) {
    const[result,setResult] = useState(route.params?.transf.data[0].data)
    console.log(result)
    const[bolsa,setBolsa] = useState(null)
    const[acao,setAcao] = useState(null)
    const[date,setDate] = useState(null)
    const[errorDate,setErrorDate] = useState('oi')
    

    const validar = () => {if ({date} == null ){  setErrorDate("Digite corretamente");} };
    return (
        <SafeAreaView style = {css.fundo}>
          <KeyboardAvoidingView behavior = {Platform.OS == 'ios'?'padding':'height'} style = {css.fundo}>
            <View>
            </View>
        
            <View style = {css.login_form}>
                <Picker  style={{ height: 50, width: 180,marginRight: 150, }} selectedValue = {bolsa} onValueChange ={(item,itemIndex) => {setBolsa(item)}}>
                    <Picker.Item label="Bovespa" value="^BVSP" />
                    <Picker.Item label="Dow Jones Industrial Average" value="^DJI" />	
                    <Picker.Item label="NASDAQ Composto" value="^IXIC" />
                </Picker>
                <Picker  style={{ height: 50, width: 400,marginRight: 50 }} selectedValue = {acao} onValueChange ={(item,itemIndex) =>{setAcao(item)}}>
                    <Picker.Item label="Banco do Brasil" value="BBAS3.SA" />
                    <Picker.Item label="Petrobras" value="PETR4.SA" />	
                    <Picker.Item label="Vale" value="VALE5.SA" />
                </Picker>
                <TextInputMask type={'datetime'} style = {css.login_input} options={{format: 'DD/MM/YYYY'}} errorMessage = {errorDate} placeholder = 'DD/MM/YYYY' value={date} onChangeText={(text) => {setDate(text)}}/>
            </View>
            {/*<ScrollView>
                {result && (result.map((elem,id) => {return(<View key = {id}><Text>{elem.data}</Text></View>)}))}

    </ScrollView>*/}
            <View>
                <TouchableOpacity title = "Teste1" onPress={()=>props.navigation.navigate('Teste1')} style = {css.login_button}><Text style = {css.login_buttonText}>Teste1</Text> </TouchableOpacity>
            </View>
            </KeyboardAvoidingView>
        </SafeAreaView>
    );
    
}
